Having regard to the Treaty establishing the European Economic Community,
Having regard to Council Regulation (EEC) No 4259/88 of 19 December 1988 applying generalized tariff preferences for 1989 in respect of textile products originating in developing countries (1), and in particular Article 13 thereof,
Whereas Article 11 of Regulation (EEC) No 4259/88 provides that preferential tariff treatment shall be accorded, for each category for products subjected in Annexes I and II thereto to individual ceilings, within the limits of the quantities specified in column 8 of Annex I and 7 of Annex II, in respect of certain or each of the countries or territories of origin referred to in column 5 of the same Annexes;
Whereas Article 12 of the abovementioned Regulation provides that the levying of customs duties may be re-established at any time in respect of imports of the products in question once the relevant individual ceilings have been reached at Community level;
Whereas, in respect of men's or boys' suits and ensembles, other than knitted or crocheted, products of category 16 (order No 40.0160) and men's or boys' singlets and other vests, underpants, briefs, nightshirts, other than knitted or crocheted, products of category 18 (order No 40.0180), the relevant ceiling amounts to 94 000 pieces and 107 000 tonnes respectively;
Whereas on 21 April 1989 imports of the products in question into the Community, originating in Pakistan, a country covered by preferential tariff arrangements, reached and were charged against that ceiling;
Whereas it is appropriate to re-establish the levying of customs duties for the products in question with regard to Pakistan,
